<!doctype html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width,initial-scale=1" />
  <title>Find Your Vespa Soulmate</title>
  <meta name="description" content="A personality-driven scooter match test." />
  <style>
    :root{
      --bg:#0b0b0f;
      --card:#13131a;
      --muted:#a8a8b3;
      --text:#f3f3f6;
      --accent:#d40000;
      --stroke: rgba(255,255,255,.12);
      --shadow: 0 18px 50px rgba(0,0,0,.45);
      --radius: 18px;
    }
    *{ box-sizing:border-box; }
    body{
      margin:0;
      font-family: ui-sans-serif, system-ui, -apple-system, Segoe UI, Roboto, Arial, "Apple Color Emoji","Segoe UI Emoji";
      background: radial-gradient(1200px 600px at 20% 10%, rgba(212,0,0,.18), transparent 60%),
                  radial-gradient(900px 500px at 80% 90%, rgba(255,255,255,.08), transparent 60%),
                  var(--bg);
      color:var(--text);
      min-height:100vh;
      display:flex;
      align-items:center;
      justify-content:center;
      padding:24px;
    }
    .wrap{ width:min(860px, 100%); }
    header{
      display:flex;
      align-items:flex-start;
      justify-content:space-between;
      gap:14px;
      margin-bottom:14px;
    }
    @media (max-width: 720px){
      header{ flex-direction:column; }
      .lang{ align-self:flex-start; }
    }
    h1{
      margin:0;
      font-size:clamp(24px, 4vw, 38px);
      letter-spacing:.2px;
    }
    header p{
      margin:6px 0 0 0;
      color:var(--muted);
      line-height:1.4;
      max-width:65ch;
    }

    .lang{
      display:flex;
      gap:8px;
      padding:6px;
      border-radius:999px;
      border:1px solid var(--stroke);
      background: rgba(255,255,255,.03);
    }
    .lang button{
      border:1px solid transparent;
      background: transparent;
      color: var(--muted);
      padding:8px 10px;
      border-radius:999px;
      cursor:pointer;
      font-size:13px;
      transition: background .15s ease, border-color .15s ease, color .15s ease;
    }
    .lang button.active{
      color: var(--text);
      border-color: rgba(212,0,0,.55);
      background: rgba(212,0,0,.16);
    }

    .card{
      background: rgba(19,19,26,.92);
      border:1px solid var(--stroke);
      border-radius: var(--radius);
      box-shadow: var(--shadow);
      overflow:hidden;
    }
    .inner{ padding:18px; }

    .progress{
      display:flex;
      align-items:center;
      justify-content:space-between;
      gap:10px;
      padding:14px 18px;
      border-bottom:1px solid var(--stroke);
      background: rgba(255,255,255,.02);
    }
    .progress .bar{
      flex:1;
      height:8px;
      border-radius:999px;
      background: rgba(255,255,255,.08);
      overflow:hidden;
    }
    .progress .bar > div{
      height:100%;
      width:0%;
      background: linear-gradient(90deg, var(--accent), rgba(212,0,0,.65));
      border-radius:999px;
      transition: width .25s ease;
    }
    .progress .step{
      font-size:13px;
      color:var(--muted);
      white-space:nowrap;
    }

    .q{
      margin:0 0 12px 0;
      font-size:18px;
      line-height:1.35;
    }
    .answers{
      display:grid;
      gap:10px;
      margin-top:10px;
    }
    button.answer{
      width:100%;
      text-align:left;
      padding:12px 12px;
      border-radius:14px;
      border:1px solid var(--stroke);
      background: rgba(255,255,255,.03);
      color:var(--text);
      cursor:pointer;
      transition: transform .05s ease, border-color .15s ease, background .15s ease;
      line-height:1.35;
    }
    button.answer:hover{
      border-color: rgba(212,0,0,.55);
      background: rgba(212,0,0,.08);
    }
    button.answer:active{ transform: translateY(1px); }

    .pill{
      display:inline-flex;
      gap:8px;
      align-items:center;
      padding:8px 10px;
      border-radius:999px;
      border:1px solid rgba(212,0,0,.35);
      background: rgba(212,0,0,.10);
      color: var(--text);
      font-size:13px;
      margin-right:10px;
    }

    .row{
      display:flex;
      gap:10px;
      flex-wrap:wrap;
      margin-top:14px;
    }
    .btn{
      border:1px solid var(--stroke);
      background: rgba(255,255,255,.03);
      color:var(--text);
      padding:10px 12px;
      border-radius:14px;
      cursor:pointer;
      transition: border-color .15s ease, background .15s ease;
      font-size:14px;
    }
    .btn.primary{
      border-color: rgba(212,0,0,.55);
      background: rgba(212,0,0,.16);
    }
    .btn:hover{ border-color: rgba(255,255,255,.22); }
    .btn.primary:hover{ border-color: rgba(212,0,0,.9); background: rgba(212,0,0,.22); }

    .muted{ color:var(--muted); }
    .small{ font-size:13px; }

    .result-img{
      width:100%;
      height:280px;
      border-radius:16px;
      overflow:hidden;
      border:1px solid var(--stroke);
      background: rgba(255,255,255,.02);
      margin-bottom:14px;
    }
    .result-img img{
      width:100%;
      height:100%;
      object-fit: cover;
      display:block;
    }
    @media (max-width: 520px){
      .result-img{ height:220px; }
    }

    .result-title{
      font-size:22px;
      margin:0 0 10px 0;
    }
    .result-sub{
      margin:0 0 12px 0;
      color: var(--muted);
      line-height:1.5;
    }
    .traits{
      display:flex;
      flex-wrap:wrap;
      gap:8px;
      margin-top:12px;
    }
    .trait{
      padding:7px 10px;
      border-radius:999px;
      border:1px solid var(--stroke);
      background: rgba(255,255,255,.03);
      font-size:13px;
      color: var(--text);
    }
    .scoreline{
      margin-top:12px;
      color: var(--muted);
      font-size:13px;
    }
  </style>
</head>
<body>

            vibe: "Ты — элегантный мечтатель. Лёгкая, романтичная и очень «в духе времени» — твои поездки про красоту и атмосферу.",
            traits: ["Шарм", "Лёгкость", "Романтика", "Нежная элегантность"],
            pattern: "Чаще всего E. Твой скутер — компаньон для красоты и спокойной уверенности."
          }
        }
      }
    };

    // ---------- State ----------
    const state = {
      lang: "en",
      i: 0,
      picks: [] // filled on init
    };

    const main = document.getElementById("main");
    const stepText = document.getElementById("stepText");
    const pickedText = document.getElementById("pickedText");
    const barFill = document.getElementById("barFill");
    const titleEl = document.getElementById("title");
    const subtitleEl = document.getElementById("subtitle");

    const btnEn = document.getElementById("btnEn");
    const btnRu = document.getElementById("btnRu");

    function setLang(lang){
      state.lang = lang;
      btnEn.classList.toggle("active", lang === "en");
      btnRu.classList.toggle("active", lang === "ru");

      document.documentElement.lang = (lang === "ru") ? "ru" : "en";

      const ui = content[state.lang].ui;
      titleEl.textContent = ui.title;
      subtitleEl.textContent = ui.subtitle;

      render();
    }

    function init(){
      const navLang = (navigator.language || "").toLowerCase();
      const defaultLang = navLang.startsWith("ru") ? "ru" : "en";
      state.lang = defaultLang;
      state.i = 0;
      state.picks = Array(content.en.quiz.length).fill(null);

      btnEn.addEventListener("click", () => setLang("en"));
      btnRu.addEventListener("click", () => setLang("ru"));

      setLang(defaultLang);
    }

    // ---------- Rendering ----------
    function render(){
      const ui = content[state.lang].ui;
      const quiz = content[state.lang].quiz;

      const pickedCount = state.picks.filter(Boolean).length;
      pickedText.textContent = ui.picked(pickedCount, quiz.length);
      barFill.style.width = `${(pickedCount/quiz.length)*100}%`;

      if (state.i < quiz.length){
        stepText.textContent = ui.questionXofY(state.i+1, quiz.length);
        const item = quiz[state.i];

        const answersHtml = item.a.map(opt => {
          const label = opt.key;
          return `<button class="answer" type="button" data-key="${label}">
            <span class="pill">${label}</span>
            ${opt.text}
          </button>`;
        }).join("");

        main.innerHTML = `
          <p class="q">${item.q}</p>
          <div class="answers">${answersHtml}</div>
          <div class="row">
            <button class="btn" id="backBtn" type="button" ${state.i===0 ? "disabled" : ""}>${ui.back}</button>
            <button class="btn" id="restartBtn" type="button">${ui.restart}</button>
          </div>
          <p class="scoreline muted small">${ui.tip}</p>
        `;

        main.querySelectorAll("button.answer").forEach(btn => {
          btn.addEventListener("click", () => {
            const key = btn.getAttribute("data-key");
            state.picks[state.i] = key;
            if (state.i < quiz.length - 1) {
              state.i++;
            } else {
              state.i = quiz.length; // jump to results
            }
            render();
          });
        });

        document.getElementById("backBtn")?.addEventListener("click", () => {
          if (state.i > 0) state.i--;
          render();
        });

        document.getElementById("restartBtn")?.addEventListener("click", reset);
      } else {
        showResult();
      }
    }

    function computeWinner(){
      const counts = {A:0, B:0, C:0, D:0, E:0};
      for (const p of state.picks){
        if (p && counts[p] != null) counts[p]++;
      }
      const order = ["A","B","C","D","E"];
      let best = "A";
      for (const k of order){
        if (counts[k] > counts[best]) best = k;
      }
      return { best, counts };
    }

    function showResult(){
      const ui = content[state.lang].ui;
      const results = content[state.lang].results;

      stepText.textContent = ui.yourResult;

      const { best, counts } = computeWinner();
      const r = results[best];

      main.innerHTML = `
        <div class="result-img"><img src="${r.img}" alt="${r.title}"></div>
        <h2 class="result-title">${r.title}</h2>
        <p class="result-sub"><strong>${ui.theVibe}</strong> ${r.vibe}</p>
        <div class="traits">
          ${r.traits.map(t => `<span class="trait">${t}</span>`).join("")}
        </div>
        <p class="scoreline"><strong>${ui.yourPattern}</strong> ${r.pattern}</p>
        <div class="row">
          <button class="btn primary" id="restartBtn2" type="button">${ui.takeAgain}</button>
        </div>
      `;

      document.getElementById("restartBtn2")?.addEventListener("click", reset);
    }

    function reset(){
      state.i = 0;
      state.picks = Array(content.en.quiz.length).fill(null);
      render();
    }

    window.addEventListener("load", init);
  </script>
